        {id: 3, message: "Im fine. What about you?"},
        {id: 4, message: "Yo"},
        {id: 5, message: "Yo"},
        {id: 5, message: "Yo"},
    ]


    return(
        <Col xs='12'>
            <Row>
                <Col xs='12'>
                    <textarea></textarea>
                    <button>Add post</button>
